import React from 'react'

const Header = () => {
  return (
    <div className='mt-8 text-center'>
        <h1 className='text-xl font-bold text-blue-600'>DIABETES RISK ASSESSMENT</h1>
        <p className='text-sm font-semibold mt-2'>Note that the results you obtain from this form only indicates a risk of having this disease and a full medical checkup is required for proper diagnosis of the condition.</p>
    </div>
  )
}

export default Header
